import React from 'react'

const StackBtn = (props)=> {

    let name = props.name

    if (name=="Node") {
        name = "nodejs"
    }

    return (
      <div className={`stack-btn stack-${name.toLowerCase()} mr-2 mb-1`}>
        <i className={`devicon-${name.toLowerCase()}-plain`}></i>
      </div>
    );
}

export default StackBtn
